import React from "react"; 
 import attach from '../img/attach.png';
 import Img from '../img/img.png';
const Input= () => {

    return (
        <div className= "input">
       <input type="text" placeholder="type somthing..."/>
       <div className="send">
        <img src={attach }alt=""/>
        <input type="file" style={{display:"none"}} id="file"/>
        <label htmlFor="file">
            <img src= {Img} alt=""/>

        </label>
        <button>Send</button>
       </div>
        </div>
    )
}
export default Input;
